import { EducationSchoolModel } from "../models/EducationSchoolModel"
import EducationSchool from "./List/EducationSchool"

function Education() {
    EducationSchoolModel.map( educationSchoolItem => {
        console.log(educationSchoolItem.name)
    })
    return(
        <div>
            <h2>Test</h2>
            <ul>
                {EducationSchoolModel.map((educationSchoolItem) => {
                    <li>{educationSchoolItem.name}</li>
                })}
            </ul>
        </div>

    )
}

export default Education
